beforeHooks.code:
try {
    driver = await new Builder().forBrowser('chrome').build();
} catch (error) {
    console.error('Error initializing the WebDriver:', error);
}

afterHooks.code:
try {
    await driver.quit();
} catch (error) {
    console.error('Error quitting the WebDriver:', error);
}

